import  React from 'react';
import './App.css';
import Data from './data.json';

function App() {
  return (
    <div className="App">
      <div className="posts">
        { Data.map(post => {
          return(
            <div key={ post.id } className="post">
              <h3>{ post.maths }</h3>
              <h3>{ post.physics }</h3>
            </div>
          )
        }) }
      </div>
    </div>
  );
}

export default App;
